column95:
33% Minidonuts mit kakaohaltiger Fettglasur und Milchschokoladestückchen: Teig (86%): Weizenmehl, Wasser, Palmöl, Zucker, Margarine (Palmfett, Wasser, Rapsöl, Zitronensaft), Hefe, Speisesalz, Emulgatoren (Mono - und Diglyceride Von Speisefettsäuren, Mono - und Diacetylweinsäureester von Mono - und Diglyceriden von Speisefettsäuren, Natriumstearoyl-2-lactylat), Weizengluten, Backtriebmittel (Diphosphate, Natriumhydrogencarbonat), Dextrose, Stabilisator (Guarkernmehl), Molkenpulver, Laktose; 
Kakaohaltige Fettglasur (10%): Zucker, pflanzliche Fette (Palmkern, Palm), fettarmes Kakaopulver 13,4%, Emulgator (Lecithine); Milchschokoladestückchen (4% ) : Zucker, Kakaobutter, Vollmilchpulver, Kakaomasse, natürliches Vanillearoma;

33% Minidonuts mit rosafarbiger Fettglasur und bunten Zuckerstreuseln:
Teig (86%): Weizenmehl, Wasser, Palmöl, Zucker, Margarine (Palmfett, Wasser, Rapsöl, Zitronensaft), Hefe, Speisesalz, Emulgatoren (Mono - und Diglyceride von Speisefettsäuren, Mono - und Diacetylweinsäureester von Mono - und Diglyceriden von Speisefettsäuren, Natriumstearoyl-2-lactylat), Weizengluten, Backtriebmittel (Diphosphate, Natriumhydrogencarbonat), Dextrose, Stabilisator (Guarkernmehl), Molkenpulver, Laktose; Rosafarbige Glasur (10%): Zucker, pflanzliche Fette (Palmkern, Kokos), Palmöl, Emulgator (Lecithine), Farbstoff (Echtes Karmin); Bunte Zuckerstreusel (4%): Zucker, Palmfett, Weizenstärke, Glukosesirup, färbende Lebensmittel (Spinat, Saflor-Extrakt, Rote-Rüben-Saftkonzentrat);

33% Minidonuts mit weißer Fettglasur und kakaohaltigen Streifen: 
Teig (88%): Weizenmehl, Wasser, Palmöl, Zucker, Margarine (Palmfett, Wasser, Rapsöl, Zitronensaft), Hefe, Speisesalz, Emulgatoren (Mono - und Diglyceride von Speisefettsäuren, Mono - und Diacetylweinsäureester von Mono - und Diglyceriden von Speisefettsäuren, Natriumstearoyl-2-lactylat), Weizengluten, Backtriebmittel (Diphosphate, Natriumhydrogencarbonat), Dextrose, Stabilisator (Guarkernmehl), Molkenpulver, Laktose; Fettglasur (12%): Zucker, pflanzliche Fette (Palmkern, Palm, Kokos), Palmöl, fettarmes Kakaopulver 1,8%, Emulgator (Lecithine).

Vollrohrzucker*°, Kakaobutter*°, Kokosraspeln*° 14%, Vollmilchpulver*, Rohrzucker*°, Kakaomasse*°, Magermilchpulver*, Haselnüsse*, Butterreinfett*. Kakao: 33% mind, (Vollmilchschokolade).

* aus kontrolliert biologischem Anbau;
° aus Fairem Handel
